      string: '{"query":"OpenLLMetry","follow_up_questions":null,"answer":null,"images":[],"results":[{"url":"https://www.traceloop.com/docs/openllmetry/introduction","title":"What
        is OpenLLMetry? - traceloop","content":"light logo\ndark logo\n\n##### Introduction\n\n#####
        Quick Start\n\n##### Tracing\n\n##### Integrations\n\n##### Privacy\n\n#####
        Contribute\n\n# What is OpenLLMetry?\n\nOpenLLMetry is an open source project
        that allows you to easily start monitoring and debugging the execution of
        your LLM app.\nTracing is done in a non-intrusive way, built on top of OpenTelemetry.\nYou
        can choose to export the traces to Traceloop, or to your existing observability
        stack. [...] You can use OpenLLMetry whether you use a framework like LangChain,
        or\ndirectly interact with a foundation model API.\n\n`import os\n\nfrom openai
        import OpenAI\nfrom traceloop.sdk import Traceloop\nfrom traceloop.sdk.decorators
        import workflow\n\nTraceloop.init(app_name=\"joke_generation_service\")","score":0.947386,"raw_content":null},{"url":"https://arize.com/docs/ax/integrations/opentelemetry/openllmetry","title":"OpenLLMetry
        | Arize Docs","content":"Logo\nLogo\n\nWas this helpful?\n\n# OpenLLMetry\n\nOpenLLMetry
        integration for sending observability data to Arize with OpenInference semantic
        conventions\n\n## Overview\n\nOpenLLMetry is an open-source observability
        package for LLM applications that provides automatic instrumentation for popular
        LLM frameworks and providers. This integration enables you to send OpenLLMetry
        traces to Arize using OpenInference semantic conventions.\n\n### Integration
        Type\n\nTracing Integration\n\n### Key Features [...] Automatic instrumentation
        for 20+ LLM providers and frameworks\n\nSeamless conversion to OpenInference
        semantic conventions\n\nReal-time trace collection and analysis in Arize\n\nSupport
        for complex LLM workflows and chains\n\n## Prerequisites\n\nArize account
        with Space ID and API Key\n\nPython 3.8 or higher\n\nOpenLLMetry and OpenTelemetry
        packages\n\nTarget LLM provider credentials (e.g., OpenAI API key)\n\n## Installation\n\n`pip
        install openinference-instrumentation-openllmetry`\n\n## Quickstart [...]
        SPACE_ID = os.getenv(\"SPACE_ID\")\nAPI_KEY = os.getenv(\"API_KEY\")\ntracer_provider
        = register(\n space_id=SPACE_ID,\n api_key=API_KEY,\n project_name=\"openllmetry-integration\",\n
        set_global_tracer_provider=True,\n)\ntracer_provider.add_span_processor(OpenInferenceSpanProcessor())\n
